B.an5=new A.V("Al cargar tu PAS en TurnoMaki esta se guarda SOLO en tu m\xf3vil. No es accesible por nadie m\xe1s, ni siquiera los administradores. Al cerrar sesi\xf3n se borrar\xe1 y tendr\xe1s que volver a cargarla.",null,null,null,null,null,null,null,null,null)
